import { Tooltip } from '@mui/material';
import './EnchantmentStyle.scss';

function Enchantment(props: {Name: string, Level: number, onClick: any}){
    console.log(props.Name.toString)
    console.log(props.Level)
    return (
        <Tooltip placement="top" title={props.Name !== undefined ? props.Name : "none"} disableInteractive>
            <div className="enchantment" onClick={props.onClick}>
                <img src='data:image/png;base64,'/>
                <div className='enchantment-level'>{props.Level}</div>
            </div>
        </Tooltip>
    );
}
export default Enchantment;
